      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE + col2 NOT IN ( col2 + col0, col0, - - ( - 20 ), CAST ( + - 92 AS INTEGER ), 61 - col1 + - col1, ( + - col1 ) );
  - name: tab2

outputs:
  - name: q2934.out
    data: |
      46	51	23
      64	77	40
      75	67	58
